import React from 'react'


function Todo({todo, onCloseClick, number, setNumber}){
    return(
        <div className="oneItem">
            <div className="nameItem"> {todo}</div>
                <div className="itemNumber"> -  ilość: {number}</div>
                <button className="counter" onClick={()=>{setNumber(number+1)}}> +</button>
                <button className="counter" onClick={()=>{setNumber(number-1)}}> -</button>
                <button className="removeItem" onClick={onCloseClick(todo)}>X</button>

        </div>
    )
}

export default Todo
